import React, { useState } from 'react';
import Header from './components/Header';
import TodoList from './components/TodoList';
import MemberList from './components/MemberList';
import './App.css';

function App() {
    const [username] = useState('Username'); // Remove setUsername since it's not used
    const [todos, setTodos] = useState(['Item 1', 'Item 2', 'Item 3', 'Item 4']);
    const [members, setMembers] = useState(['Member 2', 'Member 3', 'Member 4']);

    return (
        <div className="app">
            <Header username={username} />
            <TodoList todos={todos} setTodos={setTodos} />
            <MemberList members={members} setMembers={setMembers} />
        </div>
    );
}

export default App;
